import React from 'react'
import styled from 'styled-components'
function AddPost() {
    const AddBlock = styled.div`
    position:relative;
    background:white;
    width:512px;
    height:768px;
    border-radius:16px;
    margin-top:96px;
    margin-bottom:32px;
    display:flex;
    justify-content:center;
    align-items:center;

    
    
    `
    return (
        <AddBlock>
            <div className="HeaderBlock">
                <h2 className="h2">글쓰기</h2>
            </div>
            <div className="FormBlock">
                <form className="form" onSubmit={onSubmit}>
                    <input type="text" name="title" required />
                    <textarea type="textarea" maxlength="140" rows="7"></textarea>
                    <button type="button" name="submit">Add Post</button>
                </form>
            </div>
        </AddBlock>
    )
}
export default AddPost
